import React from 'react';

const Context = createContext('');

function UserProvider({children}){
    const Users = [
        {
            nome: 'Luis',
            email: 'luis@luis',
            senha: '1234'
        },
        {
            nome: 'Raquel',
            email: 'raquel@raquel',
            senha: '1234'
        }
    ]

    return(
        <Context.Provider value={Users}>
            {children}
        </Context.Provider>
    );

}

export default UserProvider;
